'use client';

import React from 'react';
import KanBanApp from './kanban-app';
import { defaultCols, defaultTasks } from './data';

const KanBanPage = () => {
  return (
    <div className="p-4 space-y-4">
      <h1 className="text-2xl font-bold">Visualização Kanban (mock)</h1>
      <KanBanApp defaultCols={defaultCols} defaultTasks={defaultTasks} />
    </div>
  );
};

export default KanBanPage;
